public static Map<String, Object> toMap(JsonObject object) {
        Map<String, Object> map = new HashMap();
        for (Map.Entry<String, JsonElement> element : object.entrySet()) {
            map.put(element.getKey(), fromJson(element.getValue()));
        }
        return map;
    }
